class Matrix5x5{
  public:
  Matrix5x5()
  {
   for(int i=0;i<5;i++)
   {
    for(int j=0;j<5;j++)
     a[i][j]=0;
   }
  }
  double get(int x,int y)
  {
   return a[x][y];
  }
  void set(int x,int y,double value)
  {
   a[x][y]=value;
  }
  friend Matrix5x5 operator+(const Matrix5x5 &m1,const Matrix5x5 &m2);
  private:
  double a[5][5];
};
Matrix5x5 operator+(const Matrix5x5 &m1,const Matrix5x5 &m2)
{
  Matrix5x5 m;
  for(int i=0;i<5;i++)
 {
  for(int j=0;j<5;j++)
   m.a[i][j]=m1.a[i][j]+m2.a[i][j];
 }
 return m;
}

