	int columns;
	double values[100][100];
	Matrix(int r,int c)
	{
		rows=r;
		columns=c;
		for(int i=1;i<=r;i++)
			for(int j=1;j<=c;j++)
				values[i][j]=0;
	}
	Matrix(int r,int c,double *a)
	{
		rows=r;
		columns=c;
		int k=0;
		for(int i=1;i<=r;i++)
			for(int j=1;j<=c;j++)
				values[i][j]=a[k++];
	}
	Matrix(const Matrix &matix2)
	{
		rows=matix2.rows;
		columns=matix2.columns;
		for(int i=1;i<=rows;i++)
			for(int j=1;j<=columns;j++)
				values[i][j]=matix2.values[i][j];
	}
	~Matrix()
	{}
	Matrix concatenateRows(const Matrix & matrix2) const
	{
		Matrix ret(rows+matrix2.rows,columns);
		for(int j=1;j<=columns;j++)
		{
			for(int i=1;i<=rows;i++)
				ret.values[i][j]=values[i][j];
			for(int i=1;i<=matrix2.rows;i++)
			{
				ret.values[rows+i][j]=matrix2.values[i][j];
			}
		}
		return ret;
	}
	Matrix concatenateColumns(const Matrix & matrix2) const
	{
		Matrix ret(rows,columns+matrix2.columns);
		for(int i=1;i<=rows;i++)
		{
			for(int j=1;j<=columns;j++)
				ret.values[i][j]=values[i][j];
			for(int j=1;j<=matrix2.columns;j++)
				ret.values[i][columns+j]=matrix2.values[i][j];
		}
		return ret;
	}
	void print()
	{
		for(int i=1;i<=rows;i++)
		{
			for(int j=1;j<=columns;j++)
			{
				cout<<"    "<<values[i][j];
			}
			cout<<endl;
		}
	}
};

