#include <iostream>
using namespace std;
class Matrix{
public:	
	int rows;
	int columns;
	double values[10000];

	Matrix(int row,int col)
	{
		rows=row;
		columns=col;
		for(int i=0;i<row;i++)
		{
			for(int j=0;j<col;j++)
			{
				values[i*col+j]=0;
			}
		}
	}
	Matrix(int row,int col,double val[])
	{
		rows=row;
		columns=col;
		for(int i=0;i<rows;i++)
		{
			for(int j=0;j<columns;j++)
			{
				values[i*columns+j]=val[i*columns+j];
			}
		}
	}
	~Matrix(){}
	void print()
	{
		for(int i=0;i<rows;i++)
		{
			for(int j=0;j<columns;j++)
			{
				cout<<"    "<<values[i*columns+j];
			}
			cout<<endl;
		}
	}
	void set(int row, int column, double value)
	{
		int i=row-1;
		int j=column-1;
		int col=this->columns;
		this->values[i*col+j]=value;
//		cout<<this->values[i*col+j]<<endl;
	}
	Matrix& operator =(const Matrix &m)
	{
		this->rows=m.rows;
		this->columns=m.columns;
		int col=m.columns;
		for(int i=0;i<m.rows;i++)
		{
			for(int j=0;j<m.columns;j++)
			{
				this->values[i*col+j]=m.values[i*col+j];
			}
		}
		return *this;
	}
};

