class MatrixSizesDoNotMatchException : public out_of_range
{
public:
	MatrixSizesDoNotMatchException() : out_of_range("") {	
	}
};
double Matrix::get(int row, int column) const
{
	if(row>this->size(1)||column>this->size(2)||row<=0||column<=0)
	{
		throw out_of_range("");
	}

	return elements[(row-1)*this->size(2)+column-1];
}
void Matrix::set(int row, int column, double value)
{
	if(row>this->size(1)||column>this->size(2)||row<=0||column<=0)
	{
		throw out_of_range("");
	}
	elements[(row-1)*this->size(2)+column-1]=value;
}
Matrix Matrix::operator + (const Matrix & matrix2) const
{
	if(this->size(1)!=matrix2.size(1)||this->size(2)!=matrix2.size(2))
		throw MatrixSizesDoNotMatchException();
	Matrix m(this->size(1),this->size(2));
	for (int i = 0; i <m.rows; ++ i) {
		for (int j = 0; j < m.columns; ++ j) {
			double value=this->get(i+1,j+1)+matrix2.get(i+1,j+1);
			m.set(i+1,j+1,value);
		}
	}
//	print(m);
	return m;	
}

